            "__v": 0,
            "review": "Знаете, как игры работают? ну тип ты сначала не очень сильный, со временем всё лучше и лучше. Из грязи в князи, так сказать. Так вот, эта игра хуй клала на это понятие. С каждым боссом ты становишься всё слабее. Это работало-бы, если б тебе надо было одно и того-же босса бить, а так нихуя не понятно, на сколько меньше бьёшь и тд, просто кнопочек меньше становится. Ну ещё тут ты играешь за семилетнего мальчика и это очень плохой клон Дарк Солса, Это не играем."
