            "description": "Пока эффект активен:\nСтример выбирает пять точек на карте, до которых может дойти. Чат выбирает, на какой сектор пойдёт стример путём голосования на Твиче по команде /poll. Время голосования — 1-2 минуты по желанию стримера. \nГолосование нельзя «бустить» какими-либо настройками с привилегиями для обладателей платной подписки или за баллы канала. \nЗа этот ход стример может заходить на другие сектора, чтобы совершать покупки у интересующих его торговцев, но конечным сектором хода должен быть тот, который выбрал чат.",
